import './App.css'
import Todo from './models/Todo'
import Todos from './componenets/Todos'

function App() {
  const todos = [new Todo('Learn React'), new Todo('Learn TS')]
  return (
    <div>
      <Todos items={todos} />
    </div>
  )
}

export default App
